import React from 'react';
import styles from './users.module.css';

let Users=(props)=>{
    debugger;
    let userItems=props.users.users.map((i)=>{
        return (
            <div>
                <span>
                    <div>
                        <img src={i.photoUrl} className={styles.userPhoto}/>
                    </div>
                    <div><button>Follow</button></div>
                </span>
                <span>
                    <span>
                        <div>{i.fullName}</div>
                        <div>{i.status}</div>
                    </span>
                    <span>
                        <div>{i.location.country}</div>
                        <div>{i.location.city}</div>
                    </span>
                </span>
            </div>
        )
    })
    return (
        <div>
            {userItems}
        </div>
    )
}

export default Users;
